import React from "react";
import './home.css';
import axios from 'axios';

function Home() {
    return (
        <div className="home">
          
            <div className="intro">
                <div className="overlay">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-8 col-md-offset-2 intro-text">
                                <h1>Houses & Appartments</h1><br />
                                For Rentals.
                                <h2>Find your dream home here...!!</h2><br />

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
